// Login.js

import React from "react";
import "./Login.css"; // Importing the CSS file

const Login = () => {
    const ClearOutput = () => {
        const Email = document.getElementById('email-address');
        const Password = document.getElementById('password');

        if (!(Email === "") || !(Password === "")) {
            Email.value = "";
            Password.value = "";
        }
    };

    const handleLogin = () => {
        // Implement login logic here
    };

    return (
        <div className="login-container">
            <div className="background-image">
                <div className="blue-box"></div>
            </div>
            <div className="login-content">
                <h1 className="login-title">Student Log In</h1>
                <form className="login-form">
                    <div className="form-group">
                        <label className="form-label" htmlFor="email-address">Email</label>
                        <input className="form-input" type="email" name="email-address" id="email-address" />
                    </div>
                    <div className="form-group">
                        <label className="form-label" htmlFor="password">Password</label>
                        <input className="form-input" type="password" name="password" id="password" />
                    </div>
                    <div className="form-group">
                        <a href="#0" className="forgot-password">Forgot your password?</a>
                    </div>
                    <div className="form-actions">
                        <button className="login-button" type="button" onClick={handleLogin}>Log In</button>
                        <button className="clear-button" type="reset" onClick={ClearOutput}>Clear</button>
                    </div>
                </form>
            </div>
            <footer className="footer">
                <small className="copyright">Â© Created by Group CC, All Rights Reserved.</small>
            </footer>
        </div>
    );
}

export default Login;
